import {useState} from 'react';

function Testcomp(){
    const [count,setCount] = useState(0);
    const onIncrease = () => {
        setCount(count + 1);
    };
    const onDecrease = () => {
        setCount(count - 1);
    };
    return(
        <div>
            <h4>테스트 컴포넌트</h4>
            <div>
                <b>{count}</b>
            </div>
            <div>
                <button onClick={onIncrease}>+</button>
                <button onClick={onDecrease}>-</button>
            </div>
        </div>
    );
}

export default Testcomp;
